        FROM 's3://dbt-tutorial-public/jaffle_shop_orders.csv'
        FILE_FORMAT = (
        TYPE = 'CSV'
        FIELD_DELIMITER = ','
        SKIP_HEADER = 1
    );

    -- payments table
