        id integer,
        orderid integer,
        paymentmethod varchar,
        status varchar,
        amount integer,
        created date,
        _batched_at timestamp DEFAULT CURRENT_TIMESTAMP
    );
    COPY INTO {{ database }}.stripe.payment (id, orderid, paymentmethod, status, amount, created)
        FROM 's3://dbt-tutorial-public/stripe_payments.csv'
        FILE_FORMAT = (
