            wrap_string_with_quotes(node.type_params.expr),
            wrap_string_with_quotes(node.type_params.window),
            wrap_string_with_quotes(node.type_params.grain_to_date),
            wrap_string_with_quotes(node.meta | tojson)
            ]
          %}

        {%- do values.append(values_line) -%}

    {%- endfor -%}
    {%- endif -%}

    {{ return(values) }}

{%- endmacro -%}

{%- macro default__get_source_values() -%}

    {%- if execute -%}
    {%- set nodes_list = graph.sources.values() -%}
    {%- set values = [] -%}

    {%- for node in nodes_list -%}

        {%- set exclude_source = dbt_project_evaluator.set_is_excluded(node, resource_type="source") -%}

         {%- set values_line = 
            [
              wrap_string_with_quotes(node.unique_id),
              wrap_string_with_quotes(node.name),
              wrap_string_with_quotes(node.original_file_path | replace("\\","\\\\")),
              wrap_string_with_quotes(node.alias),
              wrap_string_with_quotes(node.resource_type),
              wrap_string_with_quotes(node.source_name),
              "cast(" ~ dbt_project_evaluator.is_not_empty_string(node.source_description) | trim ~ " as boolean)",
              "cast(" ~ dbt_project_evaluator.is_not_empty_string(node.description) | trim ~ " as boolean)",
              "cast(" ~ node.config.enabled ~ " as boolean)",
              wrap_string_with_quotes(node.loaded_at_field | replace("'", "_")),
              wrap_string_with_quotes(node.database),
              wrap_string_with_quotes(node.schema),
              wrap_string_with_quotes(node.package_name),
              wrap_string_with_quotes(node.loader),
              wrap_string_with_quotes(node.identifier),
              wrap_string_with_quotes(node.meta | tojson),
              "cast(" ~ exclude_source ~ " as boolean)",
            ]
        %}

        {%- do values.append(values_line) -%}

    {%- endfor -%}
    {%- endif -%}


    {{ return(values) }}

{%- endmacro -%}

{%- macro default__get_relationship_values(node_type) -%}

    {%- if execute -%}
        {%- if node_type == 'nodes' %}
            {% set nodes_list = graph.nodes.values() %}   
        {%- elif node_type == 'exposures' -%}
            {% set nodes_list = graph.exposures.values() %}
        {%- elif node_type == 'metrics' -%}
            {% set nodes_list = graph.metrics.values() %}
        {%- else -%}
            {{ exceptions.raise_compiler_error("node_type needs to be either nodes, exposures or metrics, got " ~ node_type) }}
        {% endif -%}

        {%- set values = [] -%}

        {%- for node in nodes_list -%}

            {%- if node.get('depends_on',{}).get('nodes',[]) |length == 0 -%}

                {%- set values_line = 
                  [
                    "cast('" ~ node.unique_id ~ "' as " ~ dbt.type_string() ~ ")",
                    "cast(NULL as " ~ dbt.type_string() ~ ")",
                    "FALSE",
                  ] 
                %}

                {%- do values.append(values_line) -%}

            {%- else -%}       

                {%- for parent in node.get('depends_on',{}).get('nodes',[]) -%}

                    {%- set values_line = 
                        [
                            "cast('" ~ node.unique_id ~ "' as " ~ dbt.type_string() ~ ")",
                            "cast('" ~ parent ~ "' as " ~ dbt.type_string() ~ ")",
                            "" ~ loop.last ~ "" if node.unique_id.split('.')[0] == 'test' else "FALSE"
                        ]
                    %}

                    {%- do values.append(values_line) -%}

                {%- endfor -%}

            {%- endif -%}

        {%- endfor -%}

    {{ return(values) }}

    {%- endif -%}

{%- endmacro -%}

macro.dbt_project_evaluator.print_dbt_pr.macro_sql:
{% macro print_dbt_project_evaluator_issues(format='table') %}

  {%- if flags.WHICH in ["build","test"] -%}
    {{ print("\n### List of issues raised by dbt_project_evaluator ###") }}

    {% for result in results | selectattr('failures') | selectattr('failures', '>', 0) %}

      {% if result.node.fqn[0] == "dbt_project_evaluator" %}

        {{ print("\n-- " ~ result.node.alias ~ " --") }}

        {% set unique_id_model_checked = result.node.depends_on.nodes[0] %}

        {% set model_details = graph["nodes"][unique_id_model_checked] %}
        {% set name_model_checked = model_details.alias %}
        {% set model_schema = model_details.schema %}
        {% set model_database = model_details.database %}
        {% set db_schema = model_database ~ "." ~ model_schema if model_database else model_schema %}

        {% set sql_statement %}
        select * from {{db_schema}}.{{name_model_checked}}
        {% endset %}

        {% set query_results = run_query(sql_statement) %}
        {% if format == 'table' %}
          {{ print(query_results.print_table(max_column_width=80, max_rows=1000) or "") }}
        {% elif format == 'csv' %}  
          {{ print(query_results.print_csv() or "") }}
        {% else %}
            {%- do exceptions.raise_compiler_error("format can only be 'table' or 'csv'") -%}
        {% endif %}


      {% endif %}

    {% endfor %}

    {{ print("\n") }}
  {%- endif %}

{% endmacro %}

